//         title={note.title}
//         content={note.content}
//         />
//     );
// }

function App() {
    return <div>
        <Header />
        {notes.map( (note) =>  
        (<Note
            id={note.id}
            key={note.id}
            title={note.title}
            content={note.content}
            />
        )
        )}
        <Footer />
    </div>
}

export default App;
